import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Search, Menu, X, User, LogOut, LogIn, UserPlus, Sparkles } from 'lucide-react';
import { useAuth } from '../contexts/AuthContext';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isUserMenuOpen, setIsUserMenuOpen] = useState(false);
  const navigate = useNavigate();
  const { user, isAuthenticated, logout, loading } = useAuth();

  const handleLogout = async () => {
    await logout();
    setIsUserMenuOpen(false);
    navigate('/');
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const toggleUserMenu = () => {
    setIsUserMenuOpen(!isUserMenuOpen);
  };

  const closeMenus = () => {
    setIsMenuOpen(false);
    setIsUserMenuOpen(false);
  };

  return (
    <nav className="bg-white/80 backdrop-blur-lg border-b border-emerald-100 sticky top-0 z-50 shadow-emerald">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          {/* 로고 */}
          <div className="flex items-center">
            <Link 
              to="/" 
              className="flex-shrink-0 flex items-center group hover-scale"
              onClick={closeMenus}
            >
              <div className="flex items-center space-x-2">
                <div className="w-8 h-8 bg-gradient-emerald rounded-lg flex items-center justify-center">
                  <Sparkles className="w-5 h-5 text-white" />
                </div>
                <span className="text-2xl font-bold text-emerald-gradient">연기대본</span>
              </div>
            </Link>
          </div>

          {/* 데스크톱 메뉴 */}
          <div className="hidden md:flex items-center space-x-2">
            <Link 
              to="/" 
              className="nav-link"
            >
              홈
            </Link>
            <Link 
              to="/scripts" 
              className="nav-link"
            >
              대본 목록
            </Link>
            <Link 
              to="/add-script" 
              className="nav-link"
            >
              대본 등록
            </Link>

            {/* 인증 상태에 따른 메뉴 */}
            {loading ? (
              <div className="w-10 h-10 rounded-full pulse-emerald"></div>
            ) : isAuthenticated ? (
              <div className="relative ml-4">
                <button
                  onClick={toggleUserMenu}
                  className="flex items-center space-x-2 bg-emerald-50 hover:bg-emerald-100 text-emerald-700 px-4 py-2 rounded-xl font-medium transition-all duration-200 border border-emerald-200"
                >
                  <div className="w-6 h-6 bg-emerald-600 rounded-full flex items-center justify-center">
                    <User className="w-4 h-4 text-white" />
                  </div>
                  <span className="hidden sm:block">{user?.name || user?.username}</span>
                </button>
                
                {/* 사용자 드롭다운 메뉴 */}
                {isUserMenuOpen && (
                  <div className="dropdown-menu show">
                    <div className="px-4 py-3 text-sm text-emerald-600 border-b border-emerald-100 bg-emerald-50 rounded-t-xl">
                      <div className="font-medium">{user?.name || user?.username}</div>
                      <div className="text-xs text-emerald-500">{user?.email}</div>
                    </div>
                    <button
                      onClick={handleLogout}
                      className="dropdown-item text-red-600 hover:bg-red-50 hover:text-red-700"
                    >
                      <LogOut className="w-4 h-4 mr-3" />
                      로그아웃
                    </button>
                  </div>
                )}
              </div>
            ) : (
              <div className="flex items-center space-x-3 ml-4">
                <Link 
                  to="/login" 
                  className="flex items-center space-x-2 text-emerald-700 hover:text-emerald-800 px-4 py-2 rounded-lg font-medium transition-all duration-200 hover:bg-emerald-50"
                >
                  <LogIn className="w-4 h-4" />
                  <span>로그인</span>
                </Link>
                <Link 
                  to="/register" 
                  className="btn-primary flex items-center space-x-2"
                >
                  <UserPlus className="w-4 h-4" />
                  <span>회원가입</span>
                </Link>
              </div>
            )}
          </div>

          {/* 모바일 메뉴 버튼 */}
          <div className="md:hidden flex items-center">
            <button
              onClick={toggleMenu}
              className="inline-flex items-center justify-center p-2 rounded-xl text-emerald-600 hover:text-emerald-700 hover:bg-emerald-50 transition-colors duration-200"
            >
              {isMenuOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
            </button>
          </div>
        </div>

        {/* 모바일 메뉴 */}
        {isMenuOpen && (
          <div className="md:hidden animate-slide-up">
            <div className="px-2 pt-2 pb-3 space-y-1 bg-white/90 backdrop-blur-lg rounded-2xl mt-2 border border-emerald-100 shadow-emerald">
              <Link 
                to="/" 
                className="block px-4 py-3 rounded-xl text-base font-medium text-gray-700 hover:text-emerald-700 hover:bg-emerald-50 transition-colors duration-200"
                onClick={closeMenus}
              >
                홈
              </Link>
              <Link 
                to="/scripts" 
                className="block px-4 py-3 rounded-xl text-base font-medium text-gray-700 hover:text-emerald-700 hover:bg-emerald-50 transition-colors duration-200"
                onClick={closeMenus}
              >
                대본 목록
              </Link>
              <Link 
                to="/add-script" 
                className="block px-4 py-3 rounded-xl text-base font-medium text-gray-700 hover:text-emerald-700 hover:bg-emerald-50 transition-colors duration-200"
                onClick={closeMenus}
              >
                대본 등록
              </Link>

              {/* 모바일 인증 메뉴 */}
              {loading ? (
                <div className="px-4 py-3">
                  <div className="h-4 pulse-emerald rounded-full"></div>
                </div>
              ) : isAuthenticated ? (
                <div className="border-t border-emerald-100 pt-3 mt-3">
                  <div className="px-4 py-3 bg-emerald-50 rounded-xl mb-2">
                    <div className="text-sm font-medium text-emerald-800">{user?.name || user?.username}</div>
                    <div className="text-xs text-emerald-600">{user?.email}</div>
                  </div>
                  <button
                    onClick={() => {
                      handleLogout();
                      closeMenus();
                    }}
                    className="w-full text-left flex items-center px-4 py-3 rounded-xl text-base font-medium text-red-600 hover:text-red-700 hover:bg-red-50 transition-colors duration-200"
                  >
                    <LogOut className="w-5 h-5 mr-3" />
                    로그아웃
                  </button>
                </div>
              ) : (
                <div className="border-t border-emerald-100 pt-3 mt-3 space-y-2">
                  <Link 
                    to="/login" 
                    className="flex items-center px-4 py-3 rounded-xl text-base font-medium text-emerald-700 hover:text-emerald-800 hover:bg-emerald-50 transition-colors duration-200"
                    onClick={closeMenus}
                  >
                    <LogIn className="w-5 h-5 mr-3" />
                    로그인
                  </Link>
                  <Link 
                    to="/register" 
                    className="flex items-center px-4 py-3 rounded-xl text-base font-medium bg-emerald-600 text-white hover:bg-emerald-700 transition-colors duration-200"
                    onClick={closeMenus}
                  >
                    <UserPlus className="w-5 h-5 mr-3" />
                    회원가입
                  </Link>
                </div>
              )}
            </div>
          </div>
        )}
      </div>

      {/* 배경 클릭 시 메뉴 닫기 */}
      {(isUserMenuOpen || isMenuOpen) && (
        <div 
          className="fixed inset-0 z-40 bg-black/20 backdrop-blur-sm" 
          onClick={closeMenus}
        ></div>
      )}
    </nav>
  );
};

export default Navbar;
